import React from "react";


class Profile extends React.Component {
  render() {
    return(
      <div id={this.props.name}>
      {this.props.picture}
      <h1>{this.props.name}</h1>
      <p>{this.props.bio}</p>
      </div>
    )

  }
}


export default Profile
